export class Home extends Component {
  render() {
    return (
      <div >
       <img src="http://www.crowneplazaphx.com/resourcefiles/smallimages/location-of-phoenix-arizona-hotel-sm.jpg" alt="placeholder"/>
      </div>
    )
  }
}

export default Home
